import React from "react";
import { View, Text } from "react-native";

export default function ChatRoom({ route }) {
  const { bookingId, driverId, passengerId, role } = route.params || {};

  return (
    <View style={{ flex: 1, padding: 16 }}>
      <Text style={{ fontWeight: "700", fontSize: 18, marginBottom: 8 }}>
        Chat Room
      </Text>
      <Text>Booking: {bookingId}</Text>
      <Text>Driver: {driverId}</Text>
      <Text>Passenger: {passengerId}</Text>
      <Text>Role: {role}</Text>
    </View>
  );
}
